const folderPath="/assets/wasm/";const appFileName="cf2d0457.wasm";if(!WebAssembly.instantiateStreaming){WebAssembly.instantiateStreaming=async(resp,importObject)=>{const source=await(await resp).arrayBuffer();return await WebAssembly.instantiate(source,importObject)}}const go=new Go;let mod,inst;WebAssembly.instantiateStreaming(fetch(folderPath+appFileName),go.importObject).then(result=>{mod=result.module;inst=result.instance;document.getElementById("runButton").disabled=false}).catch(err=>{console.error(err)});async function run(){console.clear();await go.run(inst);inst=await WebAssembly.instantiate(mod,go.importObject)}
